import React from 'react';
import { Route, Routes, BrowserRouter} from 'react-router-dom'
import Home from './components/Home';
import { ToastContainer } from 'react-toastify';

const App: React.FC = () => {
  return (
    <div className="App">
    <ToastContainer
      position="top-center"
      autoClose={5000}
      hideProgressBar={false}
      newestOnTop={false}
      closeOnClick
      rtl={false}
      pauseOnFocusLoss
      draggable
      pauseOnHover
      theme="colored"
    />
      <h1>SendBird Chat Application</h1>
      <BrowserRouter>
      <Routes>
        <Route path='/home' element={<Home />}/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
